import React from "react";

const Score = ({ scoreBlack, scoreWhite }) => {
  return (
    <div className="scores">
      <h3>Scores</h3>
      <p>Player: {scoreBlack}</p>
      <p>Bot: {scoreWhite}</p>
    </div>
  );
};

export default Score;
